import React, { useEffect, useState } from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { Link } from "react-router-dom";
import axios from "axios";


const MyDoctors = () => {
  const [doctors, setDoctors] = useState([]);
  const [name, setName] = useState("");
  const [username, setUsername] = useState("");
  const [hospitalName, setHospitalName] = useState("");
  const [department, setDepartment] = useState("");
  const [designation, setDesignation] = useState("");
  const [area, setArea] = useState("");

  const [query, setQuery] = useState();

  const loadDoctors = async () => {
    const url = "http://localhost:8000/patients/doctor-list";

    const res = axios
      .get(url, { params: query })
      .then((response) => {
        
        setDoctors(response.data.doctors);
        console.log(response.data.doctors[0].consultency[0]);
       
      })
      .catch((error) => {
        console.log(error);
      });
   
  };

  const doDoctorSearch = () => {
    setQuery({
      department: department,
      designation: designation,
      name: name,
      area: area,
    });
  };

  useEffect(() => {
   
    loadDoctors();
  }, [query]);

  return (
    <>

    <div className="max-w-[1320px] mx-auto">
      <h1 className="text-3xl font-bold text-center mt-10">My Doctors</h1>
    
  
  <div className="bg-white shadow-md rounded-lg overflow-hidden">
    <img className="w-full h-56 object-cover object-center" src="image1.jpg" alt="Card Image"/>
    <div className="p-4">
      <h2 className="font-bold text-xl mb-2">Card Title 1</h2>
      <p className="text-gray-700">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </div>
  </div>

  
  </div>
    </>
    
  )
}

export default MyDoctors
